import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Home from './App'

export default function Script(){
    return(
        <div>
            <BrowserRouter>
                <Routes>
                    <Route path='/home' index element={<Home/>}/>    
                </Routes>            
            </BrowserRouter>
        </div>
    )
}
